import React from "react";
import { Link } from 'react-router-dom'
import { Input, Button, Icon } from "flwww";

import './admin-login.styles.css';

class AdminLogin extends React.Component {
  constructor() {
    super();
    this.state = {
      error: false,
      loading: false
    }
  }
  render() {
    return (
      <div className='admin-login'>
        <div>
          <Link to='/'>
            <Icon type="arrowLeftCircle" size="30px" color="#079992"/>
            {/* <span>Back</span> */}
          </Link>
        </div>
        <Input
          style={{ fontSize: "1rem", marginBottom: ".7rem" }}
          icon="user"
          error={this.state.error}
          placeholder="username" />

        <Input
          style={{ fontSize: "1rem", marginBottom: ".7rem" }}
          placeholder="Password" />

        <Button outlined loading={this.state.loading}>Login</Button>
      </div>
    );
  }
}

export default AdminLogin;
